instance Dist(Binomial, Nat, Float)
  def density(d, x) =
    if (d.prob == 0.0)
      then
        if (x == 0)
          then Exp 0.0
          else Exp (-infinity)
      else
        if (d.prob == 1.0)
          then
            if (x == d.trials)
              then Exp 0.0
              else Exp (-infinity)
          else
            tf = n_to_f d.trials
            xf = n_to_f x
            if (xf > tf)
              then Exp (-infinity)
              else Exp ( (xf * log d.prob) + ((tf - xf) * log1p (-d.prob)) +
                lgamma (tf + 1) - lgamma (xf + 1) - lgamma (tf + 1 - xf) )

